import React from 'react';

import './App.css';
import Home from './pages/Home';

function App() {
  const [isSticky, setSticky] = useState(false)
  const stickyRef = useRef(null) 
  return (
    <Fragment>
      <Navbar sticky={isSticky} />
      <Welcome stickyRef={stickyRef} />
    </Fragment>
  )
}

export default App;
